import React, { useState } from 'react';
import { InputText } from 'primereact/inputtext';
import { Calendar } from 'primereact/calendar';
import { Dropdown } from 'primereact/dropdown';
import { InputNumber } from 'primereact/inputnumber';
import { RadioButton } from 'primereact/radiobutton';
import { Button } from 'primereact/button';
import { InputTextarea } from 'primereact/inputtextarea';
import './BookingForm.css';  // Import external CSS for background and logo

const BookingForm = () => {
  const [formData, setFormData] = useState({
    companyName: '',
    contactName: '',
    contactEmail: '',
    eventDates: null,
    eventTime: null,
    eventType: '',
    otherFoodTrucks: 'no',
    attendees: 0,
    additionalInfo: '',
    otherVendorsCount: 0,
  });

  // Define date range logic (Min/Max)
  const today = new Date();
  const minDate = new Date();
  minDate.setDate(today.getDate() + 7);

  const maxDate = new Date();
  maxDate.setFullYear(today.getFullYear() + 2);

  const eventTypes = [
    { label: 'Corporate', value: 'corporate' },
    { label: 'Wedding', value: 'wedding' },
    { label: 'Birthday', value: 'birthday' },
    { label: 'Festival', value: 'festival' },
    { label: 'Other', value: 'other' }
  ];

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log(formData);
    alert('Booking request submitted!');
  };

  const customStyles = `
    .p-inputtext {
      color: #DB0B00 !important; /* Rosso Corsa */
      font-family: 'Open Sans', sans-serif !important;
      font-style: italic !important;
      font-weight: 700 !important;
      font-size: 16px !important;
    }
    .p-dropdown-label, .p-inputnumber-input {
      color: #DB0B00 !important; /* Rosso Corsa */
      font-family: 'Open Sans', sans-serif !important;
      font-style: italic !important;
      font-weight: 700 !important;
      font-size: 16px !important;
    }
    .p-calendar {
      width: 100%;
    }
    .p-calendar .p-inputtext {
      width: 100%;
      padding: 12px;
      border: 1px solid #DB0B00;
      border-radius: 4px;
    }
    .p-calendar .p-button {
      background-color: #DB0B00 !important; /* Rosso Corsa */
      border-color: #DB0B00 !important; /* Rosso Corsa */
    }
    .p-calendar .p-button-icon {
      color: white !important;
    }
    ::placeholder {
      color: #DB0B00 !important;
      opacity: 0.7;
    }
  `;

  return (
    <div className="booking-form-page">
      <style>{customStyles}</style>
      {/* Logo */}
      <img
        src="/images/Birria_Boss_favicon_red.png"
        alt="Birria Boss Logo"
        className="birria-boss-logo"
      />

      <div className="form-container">
        <h1 className="form-header">Book Your Event</h1>
        <h2 className="form-subheader">Fill out the form below to get started</h2>

        {/* Form Fields */}
        <div style={{ marginBottom: '20px' }}>
          <label htmlFor="companyName" className="form-label">Company Name</label>
          <InputText
            id="companyName"
            name="companyName"
            value={formData.companyName}
            onChange={handleChange}
            placeholder="Enter company name"
            style={{ width: '100%', padding: '12px', borderRadius: '4px', border: '1px solid #DB0B00' }}
          />
        </div>

        <div style={{ marginBottom: '20px' }}>
          <label htmlFor="contactName" className="form-label">Contact Name</label>
          <InputText
            id="contactName"
            name="contactName"
            value={formData.contactName}
            onChange={handleChange}
            required
            placeholder="Enter contact name"
            style={{ width: '100%', padding: '12px', borderRadius: '4px', border: '1px solid #DB0B00' }}
          />
        </div>

        <div style={{ marginBottom: '20px' }}>
          <label htmlFor="contactEmail" className="form-label">Contact Email</label>
          <InputText
            id="contactEmail"
            name="contactEmail"
            value={formData.contactEmail}
            onChange={handleChange}
            required
            placeholder="Enter email address"
            style={{ width: '100%', padding: '12px', borderRadius: '4px', border: '1px solid #DB0B00' }}
          />
        </div>

        <div style={{ marginBottom: '20px' }}>
          <label htmlFor="eventDates" className="form-label">Event Date(s)</label>
          <Calendar
            id="eventDates"
            value={formData.eventDates}
            onChange={(e) => setFormData({ ...formData, eventDates: e.value })}
            selectionMode="multiple"
            minDate={minDate}
            maxDate={maxDate}
            showIcon
            prevIcon="pi pi-chevron-left"
            nextIcon="pi pi-chevron-right"
            readOnlyInput
            style={{ width: '100%' }}
          />
        </div>

        <div style={{ marginBottom: '20px' }}>
          <label htmlFor="eventType" className="form-label">Event Type</label>
          <Dropdown
            id="eventType"
            name="eventType"
            value={formData.eventType}
            options={eventTypes}
            onChange={(e) => setFormData({ ...formData, eventType: e.value })}
            placeholder="Select Event Type"
            style={{ width: '100%', padding: '12px', borderRadius: '4px', border: '1px solid #DB0B00' }}
          />
        </div>

        {/* Conditional Render for Other Vendors */}
        {formData.otherFoodTrucks === 'yes' && (
          <div style={{ marginBottom: '20px' }}>
            <label htmlFor="otherVendorsCount" className="form-label">How many other food vendors?</label>
            <InputNumber
              id="otherVendorsCount"
              name="otherVendorsCount"
              value={formData.otherVendorsCount}
              onValueChange={(e) => setFormData({ ...formData, otherVendorsCount: e.value })}
              required
              placeholder="Enter number of vendors"
              style={{ width: '100%', padding: '12px', borderRadius: '4px', border: '1px solid #DB0B00' }}
            />
          </div>
        )}

        <div style={{ marginBottom: '20px' }}>
          <label htmlFor="attendees" className="form-label">Expected Number of Attendees</label>
          <InputNumber
            id="attendees"
            name="attendees"
            value={formData.attendees}
            onValueChange={(e) => setFormData({ ...formData, attendees: e.value })}
            required
            placeholder="Enter number of attendees"
            style={{ width: '100%', padding: '12px', borderRadius: '4px', border: '1px solid #DB0B00' }}
          />
        </div>

        <div style={{ marginBottom: '20px' }}>
          <label htmlFor="additionalInfo" className="form-label">Additional Information</label>
          <InputTextarea
            id="additionalInfo"
            name="additionalInfo"
            value={formData.additionalInfo}
            onChange={handleChange}
            rows={4}
            placeholder="Enter any additional information"
            style={{ width: '100%', padding: '12px', borderRadius: '4px', border: '1px solid #DB0B00' }}
          />
        </div>

        <Button
          label="Submit Booking Request"
          icon="pi pi-check"
          onClick={handleSubmit}
          style={{
            backgroundColor: '#DB0B00',
            color: 'white',
            padding: '12px 24px',
            border: 'none',
            borderRadius: '4px',
            cursor: 'pointer',
            fontSize: '18px',
            fontWeight: 'bold',
          }}
        />
      </div>
    </div>
  );
};

export default BookingForm;
